Plot
Naina is an Indian girl who lives with her father, mother and grandmother in India. Unable to handle the constant bickering between his mother and his wife, he kills himself. Naina resigns herself to a live a life amidst the constant arguments. She hopes to eventually wed Rohit, and live with him, despite his failings. Then Aman moves in next door, and both fall in love with each other. Naina would like to get married to him, but he would like Naina to get married to Rohit. Naina must now find out why Aman is refusing to marry her, and if at all, there is another woman in his life.
